const gyminputformStyle = theme => ({
    paper: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "column",
        justifyContent: "flex-start",
        width: "100%",
        [theme.breakpoints.up("sm")]: {         
            marginLeft: "1rem"
        }
    },
    select: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "row",
    }
});

export default gyminputformStyle;
